import React from 'react'

const Pagination=()=> 
{


//Empty array
var numbers=[];

//for Loop
for(var i=1;i<=10;i++)
{
    numbers.push(i);
    //array.push()
}


    return (<>
        <div className="container p-5">
                
                <h2 className="text-center">Dynamic Pagination</h2>

                {/* Pagination */}
                <nav className="">
                    <ul className="pagination">
                       {
                           numbers.map((res,index)=><li className="page-item" key={index}>
                                                        <a className="page-link" href="#">{res}</a>
                                                     </li>)
                       }
                    </ul>
                </nav>
            {/* Pagination */}


            

        </div>
    </>)
}

export default Pagination
